        "><div style="display:contents">Composição</div></button></div><div class="vtex-tabs__content w-100 "><div class="vtex-store-components-3-x-specificationsTab vtex-store-components-3-x-specificationsTab--specifications-tabs pb8 c-muted-1 pv6"><div style="transition:600ms ease-in-out;height:220px;overflow:hidden;display:block" class="vtex-store-components-3-x-container vtex-store-components-3-x-container--specifications-tabs relative"><div class="vtex-store-components-3-x-content vtex-store-components-3-x-content--specifications-tabs h-auto"><div style="display:contents">O <b> O Kit Sombra Líquida Critine + Sombra Líquida Rose Quartz </b> possui 2 produtos com muito brilho, alta fixação e pigmentação, é a combinação perfeita para destacar o olhar na make. Uma maneira prática e intensa de adicionar luz ao visual, a sombra líquida Shine & Glow é super versátil, metalizada, muito pigmentada e carregada de glitter. Ou seja, ela é perfeita para iluminar a sua make e dar destaque para os seus olhos. A sombras líquida Mariana Saad by Océane tem textura molhada, mas não deixa os seus olhos pegajosos e pesados. Sua fórmula faz com que ela seque rapidamente sobre a pele, evitando que crie vincos ou transfira, além de garantir longa duração.<br><br>O <b> O Kit Sombra Líquida Critine + Sombra Líquida Rose Quartz </b> contém:<br>- 1 Sombra Líquida Citrine Mariana Saad By Océane - Shine & Glow Liquid Eyeshadow Citrine<br>- 1 Sombra Líquida Quartzo Rosa Mariana Saad By Océane - Shine & Glow Liquid Eyeshadow Rose Quartz<br><br><h2><b> Sombra Líquida Citrine Mariana Saad By Océane - Shine & Glow Liquid Eyeshadow Citrine:</b></h2><br>Olhar destacado, com muito brilho na cor dourada e acabamento impecável, são os efeitos da aplicação da Sombra Líquida Citrine Mariana Saad by Océane.<br><br><h2><b> Sombra Líquida Quartzo Rosa Mariana Saad By Océane - Shine & Glow Liquid Eyeshadow Rose Quartz:</b></h2> <br>Shine & Glow Liquid Eyeshadow Rose Quartz possui brilho rosado. Sua tonalidade é inspirada em uma pedra preciosa, e conta com partículas de brilho visíveis que refletem a luz com muita intensidade.</div></div><div class="vtex-store-components-3-x-pointerEventsNone absolute bottom-0 w-100 h-100 flex-column justify-end flex"><div style="transition:400ms ease-in-out" class="vtex-store-components-3-x-fadeBottom w-100 h-50"></div><div class="vtex-store-components-3-x-pointerEventsAuto tc w-100 bg-base"><button class="vtex-store-components-3-x-showMoreButton vtex-store-components-3-x-showMoreButton--specifications-tabs c-action-primary t-action pointer ma5 bn outline-0">Ver mais</button></div></div></div></div></div></div></div></div></div></div></div><div class="vtex-flex-layout-0-x-flexColChild vtex-flex-layout-0-x-flexColChild--product-default pb0" style="height:100%"><div class="vtex-flex-layout-0-x-flexRow vtex-flex-layout-0-x-flexRow--row-newsletter"><div class="flex mt0 mb0 pt0 pb0    justify-start vtex-flex-layout-0-x-flexRowContent vtex-flex-layout-0-x-flexRowContent--row-newsletter items-stretch w-100"><div class="pr0 items-stretch vtex-flex-layout-0-x-stretchChildrenWidth   flex" style="width:100%"><div class="vtex-flex-layout-0-x-flexCol  ml0 mr0 pl0 pr0      flex flex-column h-100 w-100"><div class="vtex-flex-layout-0-x-flexColChild pb0" style="height:100%"><div class="vtex-rich-text-0-x-container vtex-rich-text-0-x-container--title-newsletter flex tc items-center justify-center t-body c-on-base"><div class="vtex-rich-text-0-x-wrapper vtex-rich-text-0-x-wrapper--title-newsletter"><p class="lh-copy vtex-rich-text-0-x-paragraph vtex-rich-text-0-x-paragraph--title-newsletter">Receba nossas novidades!</p></div></div></div><div class="vtex-flex-layout-0-x-flexColChild pb0" style="height:100%"><div class="vtex-rich-text-0-x-container vtex-rich-text-0-x-container--sub-title-newsletter flex tc items-center justify-center t-body c-on-base"><div class="vtex-rich-text-0-x-wrapper vtex-rich-text-0-x-wrapper--sub-title-newsletter"><p class="lh-c